" <div id=\"topicContent\">",
"  <div>",
"   &nbsp;",
"  </div>",
"  <div id=\"basicsTopicMinWidth\">",
"   <div id=\"basicsTopicRight\">",
"    <div id=\"placeholder\">",
"    </div>",
"   </div>",
"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Histoplasmosis (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H629377813\">",
"      <span class=\"h1\">",
"       What is histoplasmosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Histoplasmosis is an infection caused by a fungus. It does not cause symptoms in most people. When it does cause symptoms, the symptoms can include fever, headache, muscle aches, cough, and chest pain when taking a deep breath.",
"     </p>",
"     <p>",
"      The fungus that causes histoplasmosis lives in soil that contains bird or bat droppings. The fungus can travel in dust specks that you can breathe in. Most people who get histoplasmosis get better without treatment.",
"     </p>",
"     <p>",
"      The fungus that causes histoplasmosis is found in:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Midwestern and central states in the United States, along the Ohio and Mississippi River valleys",
"       </li>",
"       <li>",
"        Some states along the east coast of the United States",
"       </li>",
"       <li>",
"        Mexico and Central and South America",
"       </li>",
"       <li>",
"        Parts of eastern and southern Europe, Africa, eastern Asia, and Australia",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Most people living in areas where the histoplasmosis fungus is found never get sick. But infections can happen in people who have trouble fighting infection and in people who are exposed to a large amount of the fungus, such as farm or construction workers or people who visit caves (called &ldquo;spelunkers&rdquo;). Histoplasmosis tends to affect the lungs. In rare cases, the infection can spread throughout the body, especially in people whose immune system is not working well.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H629377828\">",
"      <span class=\"h1\">",
"       What are the symptoms of histoplasmosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Often histoplasmosis causes no symptoms. When symptoms do occur, they can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Chills",
"       </li>",
"       <li>",
"        Headache",
"       </li>",
"       <li>",
"        Muscle aches",
"       </li>",
"       <li>",
"        Loss of appetite",
"       </li>",
"       <li>",
"        Cough",
"       </li>",
"       <li>",
"        Chest pain when taking a deep breath",
"       </li>",
"       <li>",
"        Aching joints (sometimes with a skin rash)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H629377843\">",
"      <span class=\"h1\">",
"       Is there a test for histoplasmosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If your doctor or nurse suspects you have histoplasmosis, he or she might do tests to look for signs of the infection. These can include blood or urine tests and tests on a sample of mucus that you cough up. There is also a test that involves putting a tube into your lungs to get a sample of fluid or tissue.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H629377858\">",
"      <span class=\"h1\">",
"       How is histoplasmosis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Histoplasmosis does not always need to be treated. If you are fairly healthy, your doctor or nurse might want to wait and see if you can fight off the infection on your own. He or she will want to see you every 2 to 4 weeks to make sure you are getting better.",
"     </p>",
"     <p>",
"      For people who do need to be treated, there are medicines called &ldquo;anti-fungals&rdquo; that can kill the fungus that causes histoplasmosis. Some people must take them for months or even years. This includes:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        People with HIV infection (or AIDS)",
"       </li>",
"       <li>",
"        People who have had an organ transplant",
"       </li>",
"       <li>",
"        People with cancers of the blood",
"       </li>",
"       <li>",
"        People who take medicines called &ldquo;steroids&rdquo; or other medicines that partly &ldquo;turn off&rdquo; immune system",
"       </li>",
"       <li>",
"        Pregnant women",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H629377873\">",
"      <span class=\"h1\">",
"       Can histoplasmosis be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you live in an area where histoplasmosis occurs, you can reduce your chances of getting the infection by doing the following:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Do not disturb the soil in areas where birds roost",
"       </li>",
"       <li>",
"        Do not visit areas where buildings have been demolished",
"       </li>",
"       <li>",
"        Do not explore caves",
"       </li>",
"      </ul>",
"     </p>",
"    </div>",
"    <div id=\"reviewProcess\">",
