"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Erythema infectiosum (fifth disease) (The Basics )",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/erythema-infectiosum-fifth-disease-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H18905262\">",
"      <span class=\"h1\">",
"       What is erythema infectiosum?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Erythema infectiosum is an infection that causes a rash, fever, and other symptoms. It is caused by a virus called &ldquo;human parvovirus.&rdquo; Another name for erythema infectiosum is &ldquo;fifth disease.&rdquo;",
"     </p>",
"     <p>",
"      Fifth disease is common in children. Adults can also get it. If a pregnant woman gets fifth disease, it can be dangerous for her unborn baby.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18905277\">",
"      <span class=\"h1\">",
"       What are the symptoms of fifth disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many people with fifth disease have no symptoms or only mild symptoms. Most people feel better in a few weeks.",
"     </p>",
"     <p>",
"      When symptoms do occur, they can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Headache",
"       </li>",
"       <li>",
"        Sore throat",
"       </li>",
"       <li>",
"        Itching",
"       </li>",
"       <li>",
"        Cough",
"       </li>",
"       <li>",
"        Upset stomach &ndash; With diarrhea, nausea, and vomiting",
"       </li>",
"       <li>",
"        Sneezing",
"       </li>",
"       <li>",
"        Conjunctivitis (also called &ldquo;pinkeye&rdquo;) &ndash; This is an eye infection or irritation.",
"       </li>",
"       <li>",
"        Muscle aches &nbsp;",
"       </li>",
"       <li>",
"        Joint aches &ndash; These are more common in adults who get fifth disease. Children do not get them as often.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      The first symptoms last 2 to 5 days. After that, symptoms can include: &nbsp;",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Rash on the face &ndash; Often called a &ldquo;slapped cheek&rdquo; rash, this rash makes a child&rsquo;s cheek looks bright red, as if someone just slapped it (",
"        <a class=\"graphic graphic_picture graphicRef83120 \" href=\"UTD.htm?28/9/28831\">",
"         picture 1",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Rash on the chest, back, arms, and legs &ndash; This usually shows up after the face rash. The rash makes a pattern that looks like lace (",
"        <a class=\"graphic graphic_picture graphicRef83122 \" href=\"UTD.htm?12/6/12384\">",
"         picture 2",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Joint pain &ndash; Usually in hands, wrists, knees, and feet. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Children often feel better by the time they get a rash. Sometimes, the rash comes back after it goes away. Sunlight, temperature changes, exercise, or stress can make it come back.",
"     </p>",
"     <p>",
"      People with certain medical conditions can get sicker with fifth disease than other people. They include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        People who have problems with the body&rsquo;s infection-fighting system, called the &ldquo;immune system.&rdquo;",
"       </li>",
"       <li>",
"        People who have certain conditions that affect red blood cells, such as sickle cell disease or thalassemia.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18905292\">",
"      <span class=\"h1\">",
"       Is there a test for fifth disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A doctor or nurse can usually tell if someone has it by learning about the symptoms and doing an exam. If there is any doubt, he or she can order a blood test for the virus that causes fifth disease.",
"     </p>",
"     <p>",
"      If you are pregnant and have symptoms of fifth disease, or are around someone who has it, tell your doctor or nurse right away. He or she can order a blood test to see if you have the infection. Your doctor or nurse can also do tests to see if your unborn baby has the infection.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18905307\">",
"      <span class=\"h1\">",
"       Should my child see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your child has an immune or blood disorder and has symptoms of fifth disease, see the doctor or nurse.",
"     </p>",
"     <p>",
"      If you or your child has symptoms for more than a month, see your doctor or nurse. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18905324\">",
"      <span class=\"h1\">",
"       How is fifth disease treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people with fifth disease get better without treatment. If your child has itching or joint pain, the doctor or nurse might recommend medicine to help your child feel better. For example, the doctor might recommend",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"       ibuprofen",
"      </a>",
"      &nbsp;(sample brand names: Advil&reg;, Motrin&reg;) to treat pain. &nbsp;",
"     </p>",
"     <p>",
"      So far, doctors do not have a good medicine to treat the virus that causes fifth disease. Antibiotics DO NOT WORK on fifth disease.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18905338\">",
"      <span class=\"h1\">",
"       Can fifth disease be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can lower your chances of getting fifth disease by:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Washing your hands often with soap and water, or using an alcohol hand rub. Teach your children to do the same.",
"       </li>",
"       <li>",
"        Not sharing food and drinks with other people.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18905353\">",
"      <span class=\"h1\">",
"       What if I am pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you are pregnant and were around someone with the virus that causes fifth disease, ask your doctor or nurse about your risk of infection.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18905368\">",
"      <span class=\"h1\">",
"       More on this topic",
