"   </a>",
"   .",
"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     Murphy MF, Walls RW. Identification of the difficult and failed airway. In: Manual of Emergency Airway Management, 3rd, Walls RM, Murphy MF.  (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2008.",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?13/5/13399/abstract/2\">",
"      Krausz AA, El-Naaj IA, Barak M. Maxillofacial trauma patient: coping with the difficult airway. World J Emerg Surg 2009; 4:21.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?13/5/13399/abstract/3\">",
"      Connell RA, Graham CA, Munro PT. Is spinal immobilisation necessary for all patients sustaining isolated penetrating trauma? Injury 2003; 34:912.",
"     </a>",
"    </li>",
"    <li>",
"     Walls RW. Trauma. In: Manual of Emergency Airway Management, 3rd, Walls RW, Murphy MF.  (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2008.",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?13/5/13399/abstract/5\">",
"      Bair AE, Filbin MR, Kulkarni RG, Walls RM. The failed intubation attempt in the emergency department: analysis of prevalence, rescue techniques, and personnel. J Emerg Med 2002; 23:131.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?13/5/13399/abstract/6\">",
"      Mandavia DP, Qualls S, Rokos I. Emergency airway management in penetrating neck injury. Ann Emerg Med 2000; 35:221.",
"     </a>",
"    </li>",
