"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H7\">",
"      MANAGEMENT",
"     </a>",
"    </li>",
"    <li class=\"bulletItem\">",
"     <a class=\"outlineLink\" href=\"#H8\">",
"      Guiding principle: Secure the airway early",
"     </a>",
