var title_f13_5_13406="Gemcitabine and cisplatin for metastatic urothelial cancer";
var content_f13_5_13406=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F53016&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F53016&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Gemcitabine and cisplatin (GC) for metastatic urothelial cancer",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"4\">",
"        <p>",
"         Cycle length: 28 days.",
"        </p>",
"        Total cycles: 6 (maximum)*.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Gemcitabine",
"        </strong>",
"       </td>",
"       <td>",
"        1000 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Dilute in 100 mL normal saline (NS) (concentration no more than 40 mg/mL) and administer over 30 to 60 minutes.",
"       </td>",
"       <td>",
"        Days 1, 8, and 15",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Cisplatin",
"        </strong>",
"       </td>",
"       <td>",
"        70 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Dilute in 250 mL NS and administer over two hours. Do not administer with aluminum needles or sets.",
"       </td>",
"       <td>",
"        Day 2*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Hydration:",
"        </strong>",
"        Induction of diuresis using intravenous NS minimizes the risk of cisplatin nephrotoxicity. Fluid administration should be adequate to establish a urine flow of at least 100 mL/hour for two hours prior to and two hours after cisplatin administration. There are a number of alternative hydration regimens. One approach is to administer 1 liter of NS over two to three hours prior to cisplatin administration and a minimum of 500 mL either with or following the cisplatin administration. Supplementation with magnesium and potassium may be required depending upon the serum electrolytes. Some centers give mannitol (12.5 gm) with the cisplatin to encourage diuresis. The addition of furosemide is generally not required unless there is evidence of fluid overload or insufficient urine output. Refer to UpToDate topic on \"Cisplatin nephrotoxicity\", section on Prevention.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        HIGH (greater than 90 percent frequency of emesis). Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Vesicant/irritant properties:",
"        </strong>",
"        Cisplatin is an irritant at low concentrations (less than 0.5 mg/mL) but can cause necrosis at higher concentrations if infiltrated subcutaneously",
"        <sup>",
"         [2]",
"        </sup>",
"        . Refer to UpToDate topic on \"Extravasation injury from chemotherapy and other non-neoplastic vesicants\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Infection prophylaxis:",
"        </strong>",
"        Not applicable.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for preexisting baseline renal or liver dysfunction:",
"        </strong>",
"        Dose reductions are required for cisplatin in renal insufficiency. It is recommended that the cisplatin dose be reduced by 25 percent for creatinine clearance 10 to 50 mL/min and 50 percent for creatinine clearance less than 10 mL/min. There are no published studies to guide dosing in patients with liver dysfunction. There is conflicting evidence about the need for dose reduction of gemcitabine in patients with preexisting hepatic dysfunction. Specific dosing guidelines for patients with hepatic insufficiency are not provided in the US FDA-approved manufacturer's product labeling, but a reduction of at least 20 percent is prudent for patients with hyperbilirubinemia",
"        <sup>",
"         [3]",
"        </sup>",
"        . Although patients with elevated creatinine levels may have greater than expected toxicity from gemcitabine, even at reduced doses, a dose modification scheme based upon renal dysfunction has not been developed. The FDA-approved labeling states only that gemcitabine should be administered with caution in patients with evidence of significant renal dysfunction. Refer to UpToDate topics on \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\" and \"Chemotherapy hepatotoxicity and dose modification in patients with liver disease\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; CBC with differential and platelet count weekly during treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Assess electrolytes, renal, and liver function weekly during treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose alterations for toxicity:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Myelotoxicity:",
"        </strong>",
"        Each cycle should not begin until the WBC is greater than 3000/mm",
"        <sup>",
"         3",
"        </sup>",
"        and platelet count is greater than 100,000/mm",
"        <sup>",
"         3[1]",
"        </sup>",
"        . Gemcitabine should be withheld on day 8 and/or day 15 of the scheduled treatment if the WBC is less than 2000/mm",
"        <sup>",
"         3",
"        </sup>",
"        or the platelet count is less than 50,000/mm",
"        <sup>",
"         3[1]",
"        </sup>",
"        . If the day 8 or 15 dose of gemcitabine is omitted, the treatment cycle may be shortened to 21 days. This is consistent with the US FDA-approved product information to hold gemcitabine for an ANC less than 500 cells/mm",
"        <sup>",
"         3",
"        </sup>",
"        and platelets less than 50,000 cells/mm",
"        <sup>",
"         3[3]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Neurologic toxicity:",
"        </strong>",
"        Neuropathy usually is seen with cumulative doses of cisplatin &gt;400 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        , although there is marked interindividual variation. Patients with mild neuropathy can continue to receive full cisplatin doses. However, if the neuropathy interferes with function, the risk of potentially disabling neurotoxicity must be weighed against the benefit of continued treatment. Refer to UpToDate topic on \"Neurologic complications of platinum-based chemotherapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for renal dysfunction:",
"        </strong>",
"        It is recommended that subsequent doses of cisplatin be withheld until the serum creatinine is less than 1.5 mg/dL and/or BUN is less than 25 mg/dL",
"        <sup>",
"         [2]",
"        </sup>",
"        . Gemcitabine has been associated with renal failure and microangiopathic hemolytic anemia (thrombotic thrombocytopenic purpura/hemolytic uremic syndrome). Drug discontinuation is recommended if this occurs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         If there is a change in body weight of at least 10 percent, doses should be recalculated for all drugs.",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     IV: intravenous; CBC: complete blood count; WBC: white blood cell count; ANC: absolute neutrophil count; BUN: blood urea nitrogen.",
"     <br/>",
"     * An alternative regimen uses a three-week cycle consisting of gemcitabine (1200 mg/m",
"     <sup>",
"      2",
"     </sup>",
"     ) on days 1 and 8 and cisplatin (75 mg/m",
"     <sup>",
"      2",
"     </sup>",
"     ) on day 2 for a maximum of six cycles",
"     <sup>",
"      [4]",
"     </sup>",
"     .",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       van der Maase H, et al. J Clin Oncol 2000; 17:3068.",
"      </li>",
"      <li>",
"       Platinol (cisplatin) injection, powder, lyophilized, for solution. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on December 13, 2011).",
"      </li>",
"      <li>",
"       Gemzar (gemcitabine hydrochloride) injection. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on December 13, 2011).",
"      </li>",
"      <li>",
"       Adamo V, et al. Oncology 2005; 69:391.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
